import { Avatar } from "antd";
import React from "react";
import UserOutlined from "@ant-design/icons";

class Profile extends React.Component {
  render() {
    return <Avatar size={{ xl: 120, lg: 120 }} icon={<UserOutlined />} />;
  }
}

export default Profile;
